using IntervalArithmetic
using DataStructure
using BenchTest

y = DataVariable("y","real",@interval(-Inf,+Inf))
z = DataVariable("z","real",@interval(0,999))
c1 = DataConstant("c1","int",1)
eps = DataConstant("eps","real",10^-10) 

variables = [y, z]
constants = [c1]

C = DataConstraint("C_nonlin1",
                   constants,
                   variables,
                   "=",
                   y,
                   DataBinaryOperation("/",
                                       z,
                                       DataBinaryOperation("+",
                                                           z,
                                                           c1)),
                   eps)

test(C, variables, constants, ARGS)
